Vue.http.headers.common['X-CSRF-TOKEN'] = document.querySelector('#csrf-token').getAttribute('value');
Vue.component('entry', {
    template: "#entry",
    props: ['name', 'type','key'],
    data: function () {
        return {
            commodities: []
        }
    },
    methods: {
        putInCommodity: function (event) {
            this.searchCommodity();
            var inputWidth = event.target.clientWidth;
            var hideDiv = event.srcElement.nextElementSibling;
            hideDiv.style.width = inputWidth + 'px';
            hideDiv.style.display = "block";
        },
        searchCommodity: function () {
            this.$http.get('/api/dictionary/' + this.type)
                .then(function (commodities) {
                    this.commodities = commodities.data;
                    console.log("成功返回数据");
                })
                .catch(function () {
                    console.log("无法返回相应记录");
                });
        },
        setCommodity: function (key, name, event) {
            this.key = key;
            this.name = name;

            var hideDiv = event.srcElement.offsetParent;
            hideDiv.style.width = '0px';
            hideDiv.style.display = "none";
        },
        leaveCommodityList: function (event) {
            var hideDiv = event.path[3];
            hideDiv.style.width = '0px';
            hideDiv.style.display = "block";
        }
    }
});
